    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1599236366361,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1609188566730,"commentText":"<div>It turns out that a computer can't really do much. A computer can: <br></div><div>- perform simple arithmetic</div><div>- store data in variables in memory and allow those variables to take on new values</div><div>- compare different things together</div><div><br></div><div>That's pretty much it. Everything we do on computers these days is some combination of these simple operations. </div><br>Most children can do the same operations before they are 10 years old. However, computers can do these things with incredible speed. Children are slow compared to computers and tend to get cranky when you ask them to do these things billions or trillions of times a second. A computer never gets cranky and always obeys your commands!<br><br><div>This program will begin to demonstrate 'selection'. Selection is the first mechanism that we will look at to alter the default sequential flow of control. A computer can evaluate conditions in our code to determine if they are <font face=\"Courier\">true</font> or <font face=\"Courier\">false</font>. A programmer can create a 'fork in the road' where the value of an evaluated condition will decide whether one block of code is executed over another.</div><br><div>In this program I will have the computer determine whether a user supplied number is even or odd. The program will then display the result. All even numbers when divided by 2 have a remainder of 0. All odd \nnumbers when divided by 2 will have a remainder of 1. This is how I will\n detect even/odd numbers.</div><div><br></div><div>In order to do this I will use a construct called an '<font face=\"Courier\">if</font>/<font face=\"Courier\">else</font>'. If the computer tells me that a condition is <font face=\"Courier\">true</font> then one block of code will be executed. If the computer tells me it is <font face=\"Courier\">false</font> then a different block of code will be executed. </div>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"","linesBelow":"","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-166":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-166","timestamp":1504041050713,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":166,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-165","lineNumber":11,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609188671335,"commentText":"<div>I'll start by declaring an integer variable to hold the number. Eventually, I want to find out if the number entered by the user is even or odd.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"int number;","startRow":6,"startColumn":4,"endRow":6,"endColumn":15}],"imageURLs":["media/images/1608064722139-01.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"6","currentFilePath":"/evenOdd.cpp","viewableBlogText":"int main() \n{ \n    int number; \n \n    cout<<\"Enter in a number: \"; \n    cin>>number; \n     \n    return 0; \n}","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-2","displayCommentEvent":{"id":"ev-166","timestamp":1504041050713,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":166,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-165","lineNumber":11,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609188676833,"commentText":"<div>Then I ask the user to supply a value for the number. The value that gets entered by the user will go inside the 'box' in memory called <font face=\"Courier\">number</font>.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"cout<<\"Enter in a number: \"; \n    cin>>number;","startRow":8,"startColumn":4,"endRow":9,"endColumn":16}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"4","linesBelow":"3","currentFilePath":"/evenOdd.cpp","viewableBlogText":"int main() \n{ \n    int number; \n \n    cout<<\"Enter in a number: \"; \n    cin>>number; \n     \n    return 0; \n}","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-266":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-266","timestamp":1504041069673,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":266,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-265","lineNumber":19,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609188751622,"commentText":"Here I am saying to the computer, \"<i>when you take the user supplied number and mod divide it by 2 the remainder will be equal to 0.</i>\" I am asserting that as a fact even though as I am writing the code I have no idea what number the user will enter. <br><div><br></div><div>I ask the computer if it believes that is <font face=\"Courier\">true</font> or <font face=\"Courier\">false</font> by using the equals operator, <font face=\"Courier\">==</font>. This compares two values and if they are equal the result is <font face=\"Courier\">true</font>. If the two things being compared are not equal it will result in a <font face=\"Courier\">false</font> value.<br><div><br></div></div><div>The <font face=\"Courier\">==</font> looks funny, I know. It is the 'equals' relational operator in C++. In math textbooks a single = sign is used to represent equality between\n values but in C++ that operator is already used to assign a value to a \nvariable- so I can't use it the same way.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"number % 2 == 0","startRow":11,"startColumn":7,"endRow":11,"endColumn":22}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"5","linesBelow":"7","currentFilePath":"/evenOdd.cpp","viewableBlogText":"    int number; \n \n    cout<<\"Enter in a number: \"; \n    cin>>number; \n \n    if(number % 2 == 0) \n    { \n \n    } \n    else  \n    { \n         \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-5","displayCommentEvent":{"id":"ev-266","timestamp":1504041069673,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":266,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-265","lineNumber":19,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609188810303,"commentText":"<div>I am using an <font face=\"Courier\">if/else</font> to ask the computer if it believes my assertion is correct or not. When the flow of control reaches this statement the computer will evaluate my assertion and determine whether it is <font face=\"Courier\">true</font> or <font face=\"Courier\">false</font>. It will look at the value inside the variable <font face=\"Courier\">number</font> to make a determination.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"if(","startRow":11,"startColumn":4,"endRow":11,"endColumn":7},{"fileId":"fileId-0","selectedText":")","startRow":11,"startColumn":22,"endRow":11,"endColumn":23}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"5","linesBelow":"7","currentFilePath":"/evenOdd.cpp","viewableBlogText":"    int number; \n \n    cout<<\"Enter in a number: \"; \n    cin>>number; \n \n    if(number % 2 == 0) \n    { \n \n    } \n    else  \n    { \n         \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-418":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-418","timestamp":1504041156128,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":418,"type":"INSERT","fileId":"fileId-0","character":"l","previousNeighborId":"ev-417","lineNumber":18,"column":53,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609188850445,"commentText":"<div>If the assertion (also known as a 'logical expression' or 'condition') evaluates to <font face=\"Courier\">true</font> then the <font face=\"Courier\">if</font> block will be executed and the <font face=\"Courier\">else</font> block will be skipped. <br></div><div><br></div><div>The <font face=\"Courier\">if</font> block is highlighted. It is always the first block of code after the keyword <font face=\"Courier\">if</font>.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"{ \n        cout<<\"The number \"<<number<<\" is even.\"<<endl; \n    }","startRow":12,"startColumn":4,"endRow":14,"endColumn":5}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"4","currentFilePath":"/evenOdd.cpp","viewableBlogText":"    if(number % 2 == 0) \n    { \n        cout<<\"The number \"<<number<<\" is even.\"<<endl; \n    } \n    else  \n    { \n        cout<<\"The number \"<<number<<\" is odd.\"<<endl;      \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-7","displayCommentEvent":{"id":"ev-418","timestamp":1504041156128,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":418,"type":"INSERT","fileId":"fileId-0","character":"l","previousNeighborId":"ev-417","lineNumber":18,"column":53,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609189160586,"commentText":"<div>If the assertion evaluates to <font face=\"Courier\">false</font> then the <font face=\"Courier\">else</font> block will be executed and the <font face=\"Courier\">if</font> block will be skipped.</div><div><br></div><div>The <font face=\"Courier\">else</font> block always comes after the reserved word, <font face=\"Courier\">else</font>.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"else  \n    { \n        cout<<\"The number \"<<number<<\" is odd.\"<<endl;      \n    }","startRow":15,"startColumn":4,"endRow":18,"endColumn":5}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"4","linesBelow":"0","currentFilePath":"/evenOdd.cpp","viewableBlogText":"    if(number % 2 == 0) \n    { \n        cout<<\"The number \"<<number<<\" is even.\"<<endl; \n    } \n    else  \n    { \n        cout<<\"The number \"<<number<<\" is odd.\"<<endl;      \n    } ","commentTags":[],"questionCommentData":{"allAnswers":["True","False"],"correctAnswer":"False","question":"True or false, there is a value the user could enter that makes both couts (lines 14 and 18) execute?"}},{"id":"commentId-8","displayCommentEvent":{"id":"ev-418","timestamp":1504041156128,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":418,"type":"INSERT","fileId":"fileId-0","character":"l","previousNeighborId":"ev-417","lineNumber":18,"column":53,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609188916371,"commentText":"The attached picture shows how an <font face=\"Courier\">if/else</font> works. It is kind of like coming to a fork in the road and picking only one of the two paths. In this case, though, the path is made up of code and moving through the path implies that only those statements will be executed.<br><div><br></div><div>When the flow of control reaches an <font face=\"Courier\">if</font>/<font face=\"Courier\">else</font> the computer evaluates whether the assertion is <font face=\"Courier\">true</font> or <font face=\"Courier\">false</font>. One block is executed and the other is skipped. Either way the flow of control goes back to the default sequential flow afterwards.</div><div><br></div><div>Note: a block of code refers to any code inside a set of curly braces <font face=\"Courier\">{}</font>.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"if(number % 2 == 0) \n    { \n        cout<<\"The number \"<<number<<\" is even.\"<<endl; \n    } \n    else  \n    { \n        cout<<\"The number \"<<number<<\" is odd.\"<<endl;      \n    }","startRow":11,"startColumn":4,"endRow":18,"endColumn":5}],"imageURLs":["media/images/1608065649726-02.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"5","linesBelow":"0","currentFilePath":"/evenOdd.cpp","viewableBlogText":"    int number; \n \n    cout<<\"Enter in a number: \"; \n    cin>>number; \n \n    if(number % 2 == 0) \n    { \n        cout<<\"The number \"<<number<<\" is even.\"<<endl; \n    } \n    else  \n    { \n        cout<<\"The number \"<<number<<\" is odd.\"<<endl;      \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-487":[{"id":"commentId-9","displayCommentEvent":{"id":"ev-487","timestamp":1504053883361,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":487,"type":"INSERT","fileId":"fileId-0","character":"n","previousNeighborId":"ev-486","lineNumber":14,"column":13,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608066051011,"commentText":"<div>It is possible to store the result of one of these evaluated conditions in a <font face=\"Courier\">bool</font> variable if you'd like to use it later or more than once.</div><div><br></div><div>Line 12 has a lot going on. It is an assignment statement and it is evaluating a condition. Remember, the right hand side of an assignment statement is always evaluated first. Then its value is stored in the variable, <font face=\"Courier\">isEven</font>.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"bool isEven = number % 2 == 0;","startRow":11,"startColumn":4,"endRow":11,"endColumn":34}],"imageURLs":["media/images/1608066011661-03.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"5","linesBelow":"9","currentFilePath":"/evenOdd.cpp","viewableBlogText":"    int number; \n \n    cout<<\"Enter in a number: \"; \n    cin>>number; \n \n    bool isEven = number % 2 == 0; \n \n    if(isEven) \n    { \n        cout<<\"The number \"<<number<<\" is even.\"<<endl; \n    } \n    else  \n    { \n        cout<<\"The number \"<<number<<\" is odd.\"<<endl;      \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-13","displayCommentEvent":{"timestamp":1504053883361,"type":"INSERT","eventSequenceNumber":487,"createdByDevGroupId":"devGroupId-2","id":"ev-487","fileId":"fileId-0","character":"n","previousNeighborId":"ev-486","lineNumber":14,"column":13,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609189331181,"commentText":"<div>A <font face=\"Courier\">bool</font> variable can then act as a condition in an <font face=\"Courier\">if/else</font>. If the <font face=\"Courier\">bool</font> variable has a <font face=\"Courier\">true</font> value then the <font face=\"Courier\">if</font> block will be executed. If the <font face=\"Courier\">bool</font> variable has a <font face=\"Courier\">false</font> value then the <font face=\"Courier\">else</font> block will be executed.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"if(isEven)","startRow":13,"startColumn":4,"endRow":13,"endColumn":14}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"7","linesBelow":"7","currentFilePath":"/evenOdd.cpp","viewableBlogText":"    int number; \n \n    cout<<\"Enter in a number: \"; \n    cin>>number; \n \n    bool isEven = number % 2 == 0; \n \n    if(isEven) \n    { \n        cout<<\"The number \"<<number<<\" is even.\"<<endl; \n    } \n    else  \n    { \n        cout<<\"The number \"<<number<<\" is odd.\"<<endl;      \n    } ","commentTags":[],"questionCommentData":{"allAnswers":["True","False"],"correctAnswer":"True","question":"True or false, it is also acceptable to compare a bool with a value like this: if(isEven == true)"}},{"id":"commentId-11","displayCommentEvent":{"id":"ev-487","timestamp":1504053883361,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":487,"type":"INSERT","fileId":"fileId-0","character":"n","previousNeighborId":"ev-486","lineNumber":14,"column":13,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609189000836,"commentText":"It turns out that the <font face=\"Courier\">else</font> part is optional. It is perfectly acceptable to just have an <font face=\"Courier\">if</font> without an <font face=\"Courier\">else</font> but most of the time you will use both.<br><br><font face=\"Courier\">//only if it is Tuesday<br>if(isTuesday)<br>{<br>&nbsp;&nbsp;&nbsp; //perform your Tuesday routine<br>}<br><br>//always have a nice day<br>cout&lt;&lt;\"Have a nice day!!\"&lt;&lt;endl;</font><br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"if(isEven) \n    { \n        cout<<\"The number \"<<number<<\" is even.\"<<endl; \n    } \n    else  \n    { \n        cout<<\"The number \"<<number<<\" is odd.\"<<endl;      \n    }","startRow":13,"startColumn":4,"endRow":20,"endColumn":5}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/evenOdd.cpp","viewableBlogText":"    if(isEven) \n    { \n        cout<<\"The number \"<<number<<\" is even.\"<<endl; \n    } \n    else  \n    { \n        cout<<\"The number \"<<number<<\" is odd.\"<<endl;      \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-605":[{"id":"commentId-12","displayCommentEvent":{"id":"ev-605","timestamp":1504115256462,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":605,"type":"INSERT","fileId":"fileId-0","character":"d","previousNeighborId":"ev-604","lineNumber":20,"column":28,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609189048028,"commentText":"Perhaps you noticed that the lines with <font face=\"Courier\">if</font> and <font face=\"Courier\">else</font> don't end with a semi-colon.<div><br></div><div>All of the statements that I have used so far have had an imperative command associated with it. <font face=\"Courier\">cout</font> is a command to print. An assignment is a command to store a value. An arithmetic operation is a command to perform some math. These types of statements require a semi-colon to end the statement.</div><div><br></div><div>An <font face=\"Courier\">if</font> statement sets up a structural change to the flow of control. These types of statements do NOT require a semi-colon at the end. This is something that many students forget at one point or another. Please try and remember that <font face=\"Courier\">if/else</font> statements don't have semi-colons at the end.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"if(isEven) ","startRow":15,"startColumn":4,"endRow":15,"endColumn":15},{"fileId":"fileId-0","selectedText":"else","startRow":19,"startColumn":4,"endRow":19,"endColumn":8}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"3","currentFilePath":"/evenOdd.cpp","viewableBlogText":"    //if the number is even \n    if(isEven) \n    { \n        cout<<\"The number \"<<number<<\" is even.\"<<endl; \n    } \n    else //the number is odd \n    { \n        cout<<\"The number \"<<number<<\" is odd.\"<<endl;      \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-14","displayCommentEvent":{"timestamp":1504115256462,"type":"INSERT","eventSequenceNumber":605,"createdByDevGroupId":"devGroupId-2","id":"ev-605","fileId":"fileId-0","character":"d","previousNeighborId":"ev-604","lineNumber":20,"column":28,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608066468631,"commentText":"The attached screenshots show a few runs of the program.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"if(isEven) \n    { \n        cout<<\"The number \"<<number<<\" is even.\"<<endl; \n    } \n    else //the number is odd \n    { \n        cout<<\"The number \"<<number<<\" is odd.\"<<endl;      \n    }","startRow":15,"startColumn":4,"endRow":22,"endColumn":5}],"imageURLs":["media/images/1608066448097-Screen Shot 2020-12-15 at 3.06.48 PM.png","media/images/1608066448097-Screen Shot 2020-12-15 at 3.06.58 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"9","linesBelow":"0","currentFilePath":"/evenOdd.cpp","viewableBlogText":"    int number; \n \n    cout<<\"Enter in a number: \"; \n    cin>>number; \n \n    //store the result of the condition in a bool variable \n    bool isEven = number % 2 == 0; \n \n    //if the number is even \n    if(isEven) \n    { \n        cout<<\"The number \"<<number<<\" is even.\"<<endl; \n    } \n    else //the number is odd \n    { \n        cout<<\"The number \"<<number<<\" is odd.\"<<endl;      \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}]};
